/*!50001 CREATE TABLE  `datos_usuarios`(
 `login` varchar(10) ,
 `matricula` char(12) ,
 `nombrecompleto` varchar(52) ,
 `tipousuario` varchar(50) ,
 `fechacreacion` varchar(10) ,
 `expira` varchar(10) ,
 `estatus` varchar(14) 
)*/;

/*View structure for view datos_usuarios */

/*!50001 DROP TABLE IF EXISTS `datos_usuarios` */;
/*!50001 DROP VIEW IF EXISTS `datos_usuarios` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `datos_usuarios` AS select `usuarios`.`login` AS `login`,`usuarios`.`matricula` AS `matricula`,concat(`usuarios`.`nombre`,' ',`usuarios`.`paterno`,' ',`usuarios`.`materno`) AS `nombrecompleto`,`tipo_usuario`.`descripcion` AS `tipousuario`,date_format(`usuarios`.`fecha_creacion`,'%d/%m/%Y') AS `fechacreacion`,date_format(`usuarios`.`fecha_expira`,'%d/%m/%Y') AS `expira`,(case `usuarios`.`actualiza` when 1 then 'Actualizado' when 0 then 'No Actualizado' end) AS `estatus` from (`usuarios` join `tipo_usuario` on((`usuarios`.`idtipo` = `tipo_usuario`.`idtipo`))) */;

